funcSearch:
  function funcSearch() {
    log("funcSearch");

    const els = container.gtn("a").filter(el => el.attr("title") && el.attr("title").indexOf("취소") != -1);
    const dictCourse = {
      1: "하늘",
      2: "하늘",
      3: "레이크",
      4: "레이크",
      5: "클래식",
      6: "클래식",
      7: "오션",
      8: "오션",
    };
    const result = [];
    Array.from(els).forEach((el) => {
      const param = el.attr("href").inparen();
      const [date, time, course] = param;
      
      console.log("reserve search", dictCourse[course], date, time);
      result.push({ date, time, course: dictCourse[course] });
    });
    const param = {
      command: "SUCCESS_OF_RESERVE_SEARCH",
      golf_club_id: "22b9c7f6-60f5-11ec-a49a-0242ac11000b",
      device_id: "${deviceId}",
      result,
    };
    const addr = OUTER_ADDR_HEADER + "/api/reservation/newReserveSearch";
    post(addr, param, { "Content-Type": "application/json" }, (data) => {
      console.log(data);
      LOGOUT();
    });
  }
